    data: |
      SELECT - - col1 + - - CAST ( - col0 AS INTEGER ) AS col0 FROM tab0 WHERE NOT - col1 BETWEEN + ( - col1 ) * + col0 AND - 88;
  - name: tab0

outputs:
  - name: q6593.out
    data: |
      -66
      -96
      66
